import 'package:flutter/material.dart';
import 'package:flutter_screenutil/flutter_screenutil.dart';
import 'package:get/get.dart';
import 'package:prayaas_loans/config/theme_config.dart';
import 'package:prayaas_loans/services/bindings/initial_binding.dart';
import 'package:prayaas_loans/startup.dart';

import 'config/navigation_config.dart';

class App extends StatefulWidget {
  const App({Key? key}) : super(key: key);

  @override
  State<App> createState() => _AppState();
}

class _AppState extends State<App> {
  @override
  void initState() {
    // Map<String, dynamic> valueMap = json.decode(data);
    // TGLog.d("Converted data: --$valueMap");
    Startup.init();
    super.initState();
  }

  @override
  Widget build(BuildContext context) {
    return ScreenUtilInit(
      designSize: const Size(360, 690),
      minTextAdapt: true,
      splitScreenMode: true,
      builder: (BuildContext context, Widget? child) {
        return GetMaterialApp(
          debugShowCheckedModeBanner: false,
          theme: ThemeConfig.prayaasTheme,
          getPages: NavigationConfig.availableNavigation
              .map(
                (e) => GetPage(
                  name: e.route,
                  page: () => e.screen,
                  binding: e.bindings,
                ),
              )
              .toList(),
          initialRoute: NavigationConfig.initialRoute.route,
          initialBinding: InitialScreenBindings(),
        );
      },
    );
  }
}

